ExprLine.OrigStr:
If (Self.Var[SelectedTab].String = "Alerts")
	GenSetString(Self, "SelectedTab", "Rampages");
elif (Self.Var[SelectedTab].String = "Rampages")
	GenSetString(Self, "SelectedTab", "Instances");
elif (Self.Var[SelectedTab].String = "Instances")
	GenSetString(Self, "SelectedTab", "PVP");
else
	GenSetString(Self, "SelectedTab", "Alerts");
endif

If (Self.Var[SelectedTab].String = "PVP")
	GenSetString(Self, "SelectedTab", "Instances");
elif (Self.Var[SelectedTab].String = "Instances")
	GenSetString(Self, "SelectedTab", "Rampages");
elif (Self.Var[SelectedTab].String = "Rampages")
	GenSetString(Self, "SelectedTab", "Alerts");
else
	GenSetString(Self, "SelectedTab", "PVP");
endif

if ( Self.Var[SelectedTab].String = "PVP" and not Gen("PVP_List").Var[SelectedQueueName].String = "" )
	GenSendMessage(Gen("PVP_List"), "Queue_Join");
elif ( Self.Var[SelectedTab].String = "Instances" )
	GenSendMessage(Gen("Instances_List"), "Queue_Join");
elif ( Self.Var[SelectedTab].String = "Rampages" )
	GenSendMessage(Gen("Rampages_List"), "Queue_Join");
elif ( Self.Var[SelectedTab].String = "Alerts" )
	GenSendMessage(Gen("Alerts_List"), "Queue_Join");
endif


if ( Self.Var[SelectedTab].String = "PVP" and not Gen("PVP_List").Var[SelectedQueueName].String = "" )
	GenSendMessage(Gen("PVP_List"), "Queue_JoinAll");
elif ( Self.Var[SelectedTab].String = "Instances" and not Gen("Instances_List").Var[SelectedQueueName].String = "" )
	GenSendMessage(Gen("Instances_List"), "Queue_JoinAll");
elif ( Self.Var[SelectedTab].String = "Rampages" and not Gen("Rampages_List").Var[SelectedQueueName].String = "" )
	GenSendMessage(Gen("Rampages_List"), "Queue_JoinAll");
elif ( Self.Var[SelectedTab].String = "Alerts" )
	GenSendMessage(Gen("Alerts_List"), "Queue_JoinAll");
endif

if ( Self.Var[SelectedTab].String = "PVP" and not Gen("PVP_List").Var[SelectedQueueName].String = "" )
	GenSendMessage(Gen("PVP_List"), "Queue_JoinPrivate");
elif ( Self.Var[SelectedTab].String = "Rampages" )
	GenSendMessage(Gen("Rampages_List"), "Queue_JoinPrivate");
elif ( Self.Var[SelectedTab].String = "Alerts" )
	GenSendMessage(Gen("Alerts_List"), "Queue_JoinPrivate");
endif

if ( Self.Var[SelectedTab].String = "PVP" and not Gen("PVP_List").Var[SelectedQueueName].String = "" )
	GenSendMessage(Gen("PVP_List"), "Queue_TeamJoin");
elif ( Self.Var[SelectedTab].String = "Instances" and not Gen("Instances_List").Var[SelectedQueueName].String = "" )
	GenSendMessage(Gen("Instances_List"), "Queue_TeamJoin");
elif ( Self.Var[SelectedTab].String = "Rampages" and not Gen("Rampages_List").Var[SelectedQueueName].String = "" )
	GenSendMessage(Gen("Rampages_List"), "Queue_TeamJoin");
elif ( Self.Var[SelectedTab].String = "Alerts" )
	GenSendMessage(Gen("Alerts_List"), "Queue_TeamJoin");
endif


if ( Self.Var[SelectedTab].String = "PVP" and not Gen("PVP_List").Var[SelectedQueueName].String = "" )
	GenSendMessage(Gen("PVP_List"), "Queue_TeamJoinAll");
elif ( Self.Var[SelectedTab].String = "Instances" and not Gen("Instances_List").Var[SelectedQueueName].String = "" )
	GenSendMessage(Gen("Instances_List"), "Queue_TeamJoinAll");
elif ( Self.Var[SelectedTab].String = "Rampages" and not Gen("Rampages_List").Var[SelectedQueueName].String = "" )
	GenSendMessage(Gen("Rampages_List"), "Queue_TeamJoinAll");
elif ( Self.Var[SelectedTab].String = "Alerts" )
	GenSendMessage(Gen("Alerts_List"), "Queue_TeamJoinAll");
endif
